import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Posts from "./component/Posts";
import PostForm from './component/PostForm';

class App extends Component {
  render() {
    return (
      <div className="App">
      <PostForm/>
      <hr/>
       <Posts/>
      </div>
    );
  }
}

export default App;
